import { useStore } from "@/store/useStore";
import { useTranslation } from "react-i18next";
import { useNavigate } from "react-router-dom";
import {
  Carousel,
  CarouselContent,
  CarouselItem,
  CarouselNext,
  CarouselPrevious,
} from "@/components/ui/carousel";
import { motion } from "framer-motion";
import { useState, useEffect } from "react";
import { Button } from "@/components/ui/button";
import { ArrowRight } from "lucide-react";

// Category images mapping
const categoryImages: { [key: string]: string } = {
  الاضافات:
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTo8_rCFK8SIpmkhOJoZC1aj4zmJ7qg-y0u5w&s",
  "سندوتشات شاورما":
    "data:image/jpeg;base64,",
  الفته:
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQTuVZ9GpftDNMNI0dhcnGRT-wFZpxRu6bJSQ&s",
  السندوتشات:
    "data:image/jpeg;base64,",
  الكريب:
    "data:image/jpeg;base64,",
  "فراخ مشويه":
    "data:image/jpeg;base64,",
  الوجبات:
    "https://s3-eu-west-1.amazonaws.com/elmenusv5-stg/Normal/1b2f4d2c-dd16-4c0c-9285-b16b4b88ebfb.jpg",
  المقبلات:
    "data:image/jpeg;base64,",
  other:
    "https://images.unsplash.com/photo-1517248135467-4c7edcad34c4?q=80&w=1000",
};

export const CategoriesCarousel = () => {
  const { t } = useTranslation();
  const navigate = useNavigate();
  const products = useStore((state) => state.products) || [];
  const [api, setApi] = useState<any>(null);
  const [isHovered, setIsHovered] = useState(false);

  // Get unique categories with their counts
  const categories = Array.from(
    new Set(products.map((p) => p.category).filter(Boolean))
  ).map((category) => ({
    name: category,
    count: products.filter((p) => p.category === category).length,
    image: categoryImages[category.toLowerCase()] || "/categories/default.jpg",
  }));

  const handleCategoryClick = (category: string) => {
    navigate(`/products?category=${category}`);
  };

  // Auto-scroll for categories carousel
  useEffect(() => {
    if (!api || isHovered) return;

    const interval = setInterval(() => {
      if (api.canScrollNext()) {
        api.scrollNext();
      } else {
        api.scrollTo(0);
      }
    }, 5000);

    return () => clearInterval(interval);
  }, [api, isHovered]);

  if (categories.length === 0) {
    return null;
  }

  return (
    <div
      className="w-full py-12 bg-gradient-to-b from-background to-secondary/5"
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >
      <div className="container">
        <div className="flex justify-between items-center mb-8">
          <div>
            <h2 className="text-2xl md:text-3xl font-bold">
              {t("categories.title")}
            </h2>
            <p className="text-muted-foreground mt-1">
              {t("categories.subtitle")}
            </p>
          </div>
          <Button
            variant="ghost"
            className="group border border-gray-200"
            onClick={() => navigate("/products")}
          >
            {t("common.viewAll")}
            <ArrowRight className="ml-2  h-4 w-4 transition-transform group-hover:translate-x-1" />
          </Button>
        </div>

        <Carousel className="w-full" setApi={setApi}>
          <CarouselContent className="-ml-2 md:-ml-4">
            {categories.map((category) => (
              <CarouselItem
                key={category.name}
                className="pl-2 md:pl-4 basis-1/2 sm:basis-1/3 md:basis-1/4 lg:basis-1/5"
              >
                <motion.div
                  whileHover={{ scale: 1.02 }}
                  className="group relative h-48 rounded-xl overflow-hidden cursor-pointer"
                  onClick={() => handleCategoryClick(category.name)}
                >
                  <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent z-10" />
                  <img
                    src={category.image}
                    alt={category.name}
                    className="w-full h-full object-contain transition-transform duration-300 group-hover:scale-110"
                  />
                  <div className="absolute bottom-0 left-0 right-0 p-4 z-20">
                    <h3 className="text-lg font-semibold text-white">
                      {category.name}
                    </h3>
                    <p className="text-sm text-white/80">
                      {category.count} {t("common.products")}
                    </p>
                  </div>
                </motion.div>
              </CarouselItem>
            ))}
          </CarouselContent>
          <div className="hidden sm:block">
            <CarouselPrevious className="left-2" />
            <CarouselNext className="right-2" />
          </div>
        </Carousel>
      </div>
    </div>
  );
};
